DECLARE @salt varchar(32), @passWithSalt binary(32)
SET @salt = dbo.GenerateSalt(newid());
SET @passWithSalt = HASHBYTES('SHA2_256', CONCAT(@Password, @salt));
PRINT @passWithSalt

